import React from 'react';
import ClubCard from '../components/ClubCard';
import { Accordion, Container, ListGroup } from 'react-bootstrap';
import BasicCard from '../components/BasicCard';
import Layout from '../components/Layout';
import MyCard from '../components/StyledCard';
import StyledContainer from '../components/StyledContainer';
import StyledList from '../components/StyledList';

const About: React.FunctionComponent<{}> = () => {
    const ed = [
        "2019-2021"
    ]
    const ed2 = [
        "2017-2019"
    ]

    return (
        <Layout page="about">
            <h1>About Me</h1>
            <p>
                My name is Andrew Cutlip.
                I am a junior studying Computer Science at SUNY University at Buffalo.
                After my Bachelor's degree I hope to get my Master's degree in Computer Science as well.
                I hope to have an internship this summer to gain more practical experience.
                I also am open to offering my services online to anyone requesting them.
            </p>
            <StyledList>
                <h2>Education</h2>
            <MyCard title="SUNY University at Buffalo" subtitle="B.S. Computer Science" text={ed} />
            <MyCard title="SUNY Niagara County Community College" text={ed2} />
            </StyledList>
            <StyledContainer>
            <h3>Clubs</h3>
            <Accordion defaultActiveKey="0">
                <MyCard header="IEEE" eKey="0" text="Micromouse competition to build and program a robot to navigate a maze." />

                <MyCard header="Invenst" eKey="1" text="Club for technology entrepreneurship that works with startups in the buffalo area."/>

                <MyCard header="UB ACM (Association of Computing Machinery)" eKey="2" text="Holds various skill / technology workshops and yearly UB hacking hackathon." />
                </Accordion>
            </StyledContainer>
        </Layout>
    )
}

export default About;
